import React, { useState, useEffect } from 'react';
import axios from 'axios';

function TopFilms() {
  const [topFilms, setTopFilms] = useState([]);

  useEffect(() => {
    // Fetch top films data from Flask backend when the component mounts
    axios.get('/top_films')
      .then(response => {
        setTopFilms(response.data);
      })
      .catch(error => {
        console.error('Error fetching top films data:', error);
      });
  }, []);

  return (
    <div>
      <h1>Top Films</h1>
      <ul>
        {topFilms.map(film => (
          <li key={film.film_id}>
            <h2>{film.title}</h2>
            <p>Rental Count: {film.rental_count}</p>
            <p>Description: {film.description}</p>
            <p>Release Year: {film.release_year}</p>
            <p>Rating: {film.rating}</p>
            <p>Average Rental Cost: {film.average_rental_cost}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default TopFilms;
